import React from 'react';
import { makeStyles } from '@material-ui/core';
import imgHeader from '../images/bg-header-desktop.svg'


const useStyles = makeStyles({

    width:'100px',
    height:'100px'
});




export const Header = ({jobs}) => {


    return (
        <div>
            <img src={imgHeader} alt="Header" />
            <h2>{jobs}</h2>


        </div>
    )
}
